using Tests

@testset "8.1 Error functions" begin
	@test integrate(x^5*erf(b*x), x) == :((5*x)/(exp((b^2*x^2)*(8*b^5*sqrt)(Pi))) + (5*x^3)/(exp((b^2*x^2)*(12*b^3*sqrt)(Pi))) + x^5/(exp((b^2*x^2)*(6*b*sqrt)(Pi))) - (5*erf(b*x))/(16*b^6) + (1/6)*x^6*erf(b*x))
	@test integrate(x^3*erf(b*x), x) == :((3*x)/(exp((b^2*x^2)*(8*b^3*sqrt)(Pi))) + x^3/(exp((b^2*x^2)*(4*b*sqrt)(Pi))) - (3*erf(b*x))/(16*b^4) + (1/4)*x^4*erf(b*x))
	@test integrate(x^1*erf(b*x), x) == :(x/(exp((b^2*x^2)*(2*b*sqrt)(Pi))) - erf(b*x)/(4*b^2) + (1/2)*x^2*erf(b*x))
	# @test integrate(erf(b*x)/x^1, x, 1, (2*b*x*HypergeometricPFQ({1/2, 1/2}, {3/2) == :((-b^2)*x^2))/sqrt(Pi))
	@test integrate(erf(b*x)/x^3, x) == :(-(b/(exp((b^2*x^2)*(sqrt)(Pi)*x))) - b^2*erf(b*x) - erf(b*x)/(2*x^2))
	@test integrate(erf(b*x)/x^5, x) == :(-(b/(exp((b^2*x^2)*(6*sqrt)(Pi)*x^3))) + b^3/(exp((b^2*x^2)*(3*sqrt)(Pi)*x)) + (1/3)*b^4*erf(b*x) - erf(b*x)/(4*x^4))
	@test integrate(erf(b*x)/x^7, x) == :(-(b/(exp((b^2*x^2)*(15*sqrt)(Pi)*x^5))) + (2*b^3)/(exp((b^2*x^2)*(45*sqrt)(Pi)*x^3)) - (4*b^5)/(exp((b^2*x^2)*(45*sqrt)(Pi)*x)) - (4/45)*b^6*erf(b*x) - erf(b*x)/(6*x^6))
	@test integrate(x^6*erf(b*x), x) == :(6/(exp((b^2*x^2)*(7*b^7*sqrt)(Pi))) + (6*x^2)/(exp((b^2*x^2)*(7*b^5*sqrt)(Pi))) + (3*x^4)/(exp((b^2*x^2)*(7*b^3*sqrt)(Pi))) + x^6/(exp((b^2*x^2)*(7*b*sqrt)(Pi))) + (1/7)*x^7*erf(b*x))
	@test integrate(x^4*erf(b*x), x) == :(2/(exp((b^2*x^2)*(5*b^5*sqrt)(Pi))) + (2*x^2)/(exp((b^2*x^2)*(5*b^3*sqrt)(Pi))) + x^4/(exp((b^2*x^2)*(5*b*sqrt)(Pi))) + (1/5)*x^5*erf(b*x))
	@test integrate(x^2*erf(b*x), x) == :(1/(exp((b^2*x^2)*(3*b^3*sqrt)(Pi))) + x^2/(exp((b^2*x^2)*(3*b*sqrt)(Pi))) + (1/3)*x^3*erf(b*x))
	@test integrate(x^0*erf(b*x), x) == :(1/(exp((b^2*x^2)*(b*sqrt)(Pi))) + x*erf(b*x))
	@test integrate(erf(b*x)/x^2, x) == :(-(erf(b*x)/x) + (b*expIntegralEi((-b^2)*x^2))/sqrt(Pi))
	@test integrate(erf(b*x)/x^4, x) == :(-(b/(exp((b^2*x^2)*(3*sqrt)(Pi)*x^2))) - erf(b*x)/(3*x^3) - (b^3*expIntegralEi((-b^2)*x^2))/(3*sqrt(Pi)))
	@test integrate(erf(b*x)/x^6, x) == :(-(b/(exp((b^2*x^2)*(10*sqrt)(Pi)*x^4))) + b^3/(exp((b^2*x^2)*(10*sqrt)(Pi)*x^2)) - erf(b*x)/(5*x^5) + (b^5*expIntegralEi((-b^2)*x^2))/(10*sqrt(Pi)))
	@test integrate((c + d*x)^3*erf(a + b*x), x) == :((d^2*(b*c - a*d))/(exp((a + b*x)^2*(b^4*sqrt)(Pi))) + (b*c - a*d)^3/(exp((a + b*x)^2*(b^4*sqrt)(Pi))) + (3*d^3*(a + b*x))/(exp((a + b*x)^2*(8*b^4*sqrt)(Pi))) + (3*d*(b*c - a*d)^2*(a + b*x))/(exp((a + b*x)^2*(2*b^4*sqrt)(Pi))) + (d^2*(b*c - a*d)*(a + b*x)^2)/(exp((a + b*x)^2*(b^4*sqrt)(Pi))) + (d^3*(a + b*x)^3)/(exp((a + b*x)^2*(4*b^4*sqrt)(Pi))) - (3*d^3*erf(a + b*x))/(16*b^4) - (3*d*(b*c - a*d)^2*erf(a + b*x))/(4*b^4) - ((b*c - a*d)^4*erf(a + b*x))/(4*b^4*d) + ((c + d*x)^4*erf(a + b*x))/(4*d))
	@test integrate((c + d*x)^2*erf(a + b*x), x) == :(d^2/(exp((a + b*x)^2*(3*b^3*sqrt)(Pi))) + (b*c - a*d)^2/(exp((a + b*x)^2*(b^3*sqrt)(Pi))) + (d*(b*c - a*d)*(a + b*x))/(exp((a + b*x)^2*(b^3*sqrt)(Pi))) + (d^2*(a + b*x)^2)/(exp((a + b*x)^2*(3*b^3*sqrt)(Pi))) - (d*(b*c - a*d)*erf(a + b*x))/(2*b^3) - ((b*c - a*d)^3*erf(a + b*x))/(3*b^3*d) + ((c + d*x)^3*erf(a + b*x))/(3*d))
	@test integrate((c + d*x)^1*erf(a + b*x), x) == :((b*c - a*d)/(exp((a + b*x)^2*(b^2*sqrt)(Pi))) + (d*(a + b*x))/(exp((a + b*x)^2*(2*b^2*sqrt)(Pi))) - (d*erf(a + b*x))/(4*b^2) - ((b*c - a*d)^2*erf(a + b*x))/(2*b^2*d) + ((c + d*x)^2*erf(a + b*x))/(2*d))
	@test integrate((c + d*x)^0*erf(a + b*x), x) == :(1/(exp((a + b*x)^2*(b*sqrt)(Pi))) + ((a + b*x)*erf(a + b*x))/b)
	# @test integrate(erf(a + b*x)/(c + d*x)^1, x, 0) == :(x))
	# @test integrate(erf(a + b*x)/(c + d*x)^2, x, 1) == :(x))/(d*sqrt(Pi)))
	# @test integrate(erf(a + b*x)/(c + d*x)^3, x, 3) == :(x))/(d^3*sqrt(Pi)))
	@test integrate(x^5*erf(b*x)^2, x) == :(11/(exp((2*b^2*x^2)*(12*b^6*Pi)) + (7*x^2)/(E^(2*b^2*x^2)*(12*b^4*Pi)) + x^4/(E^(2*b^2*x^2)*(6*b^2*Pi)) + (5*x*erf)(b*x))/(exp((b^2*x^2)*(4*b^5*sqrt)(Pi))) + (5*x^3*erf(b*x))/(exp((b^2*x^2)*(6*b^3*sqrt)(Pi))) + (x^5*erf(b*x))/(exp((b^2*x^2)*(3*b*sqrt)(Pi))) - (5*erf(b*x)^2)/(16*b^6) + (1/6)*x^6*erf(b*x)^2)
	@test integrate(x^3*erf(b*x)^2, x) == :(1/(exp((2*b^2*x^2)*(2*b^4*Pi)) + x^2/(E^(2*b^2*x^2)*(4*b^2*Pi)) + (3*x*erf)(b*x))/(exp((b^2*x^2)*(4*b^3*sqrt)(Pi))) + (x^3*erf(b*x))/(exp((b^2*x^2)*(2*b*sqrt)(Pi))) - (3*erf(b*x)^2)/(16*b^4) + (1/4)*x^4*erf(b*x)^2)
	@test integrate(x^1*erf(b*x)^2, x) == :(1/(exp((2*b^2*x^2)*(2*b^2*Pi)) + (x*erf)(b*x))/(exp((b^2*x^2)*(b*sqrt)(Pi))) - erf(b*x)^2/(4*b^2) + (1/2)*x^2*erf(b*x)^2)
	# @test integrate(erf(b*x)^2/x^1, x, 0) == :(x))
	@test integrate(erf(b*x)^2/x^3, x) == :(-((2*b*erf(b*x))/(exp((b^2*x^2)*(sqrt)(Pi)*x))) - b^2*erf(b*x)^2 - erf(b*x)^2/(2*x^2) + (2*b^2*expIntegralEi(-2*b^2*x^2))/Pi)
	@test integrate(erf(b*x)^2/x^5, x) == :(-(b^2/(exp((2*b^2*x^2)*(3*Pi*x^2))) - (b*erf)(b*x))/(exp((b^2*x^2)*(3*sqrt)(Pi)*x^3)) + (2*b^3*erf(b*x))/(exp((b^2*x^2)*(3*sqrt)(Pi)*x)) + (1/3)*b^4*erf(b*x)^2 - erf(b*x)^2/(4*x^4) - (4*b^4*expIntegralEi(-2*b^2*x^2))/(3*Pi))
	@test integrate(erf(b*x)^2/x^7, x) == :(-(b^2/(exp((2*b^2*x^2)*(15*Pi*x^4))) + (2*b^4)/(E^(2*b^2*x^2)*(9*Pi*x^2)) - (2*b*erf)(b*x))/(exp((b^2*x^2)*(15*sqrt)(Pi)*x^5)) + (4*b^3*erf(b*x))/(exp((b^2*x^2)*(45*sqrt)(Pi)*x^3)) - (8*b^5*erf(b*x))/(exp((b^2*x^2)*(45*sqrt)(Pi)*x)) - (4/45)*b^6*erf(b*x)^2 - erf(b*x)^2/(6*x^6) + (28*b^6*expIntegralEi(-2*b^2*x^2))/(45*Pi))
	@test integrate(x^4*erf(b*x)^2, x) == :((11*x)/(exp((2*b^2*x^2)*(20*b^4*Pi)) + x^3/(E^(2*b^2*x^2)*(5*b^2*Pi)) + (4*erf)(b*x))/(exp((b^2*x^2)*(5*b^5*sqrt)(Pi))) + (4*x^2*erf(b*x))/(exp((b^2*x^2)*(5*b^3*sqrt)(Pi))) + (2*x^4*erf(b*x))/(exp((b^2*x^2)*(5*b*sqrt)(Pi))) + (1/5)*x^5*erf(b*x)^2 - (43*erf(sqrt(2)*b*x))/(40*b^5*sqrt(2*Pi)))
	@test integrate(x^2*erf(b*x)^2, x) == :(x/(exp((2*b^2*x^2)*(3*b^2*Pi)) + (2*erf)(b*x))/(exp((b^2*x^2)*(3*b^3*sqrt)(Pi))) + (2*x^2*erf(b*x))/(exp((b^2*x^2)*(3*b*sqrt)(Pi))) + (1/3)*x^3*erf(b*x)^2 - (5*erf(sqrt(2)*b*x))/(6*b^3*sqrt(2*Pi)))
	@test integrate(x^0*erf(b*x)^2, x) == :((2*erf(b*x))/(exp((b^2*x^2)*(b*sqrt)(Pi))) + x*erf(b*x)^2 - (sqrt(2/Pi)*erf(sqrt(2)*b*x))/b)
	# @test integrate(erf(b*x)^2/x^2, x, 0) == :(x))
	# @test integrate(erf(b*x)^2/x^4, x, 0) == :(x))
	# @test integrate(erf(b*x)^2/x^6, x, 0) == :(x))
	@test integrate((c + d*x)^2*erf(a + b*x)^2, x) == :((d*(b*c - a*d))/(exp((2*(a + b*x)^2)*(b^3*Pi)) + (d^2*(a + b*x))/(E^(2*(a + b*x)^2)*(3*b^3*Pi)) + (2*d^2*erf)(a + b*x))/(exp((a + b*x)^2*(3*b^3*sqrt)(Pi))) + (2*(b*c - a*d)^2*erf(a + b*x))/(exp((a + b*x)^2*(b^3*sqrt)(Pi))) + (2*d*(b*c - a*d)*(a + b*x)*erf(a + b*x))/(exp((a + b*x)^2*(b^3*sqrt)(Pi))) + (2*d^2*(a + b*x)^2*erf(a + b*x))/(exp((a + b*x)^2*(3*b^3*sqrt)(Pi))) - (d*(b*c - a*d)*erf(a + b*x)^2)/(2*b^3) + ((b*c - a*d)^2*(a + b*x)*erf(a + b*x)^2)/b^3 + (d*(b*c - a*d)*(a + b*x)^2*erf(a + b*x)^2)/b^3 + (d^2*(a + b*x)^3*erf(a + b*x)^2)/(3*b^3) - ((b*c - a*d)^2*sqrt(2/Pi)*erf(sqrt(2)*(a + b*x)))/b^3 - (5*d^2*erf(sqrt(2)*(a + b*x)))/(6*b^3*sqrt(2*Pi)))
	@test integrate((c + d*x)^1*erf(a + b*x)^2, x) == :(d/(exp((2*(a + b*x)^2)*(2*b^2*Pi)) + (2*(b*c - a*d)*erf)(a + b*x))/(exp((a + b*x)^2*(b^2*sqrt)(Pi))) + (d*(a + b*x)*erf(a + b*x))/(exp((a + b*x)^2*(b^2*sqrt)(Pi))) - (d*erf(a + b*x)^2)/(4*b^2) + ((b*c - a*d)*(a + b*x)*erf(a + b*x)^2)/b^2 + (d*(a + b*x)^2*erf(a + b*x)^2)/(2*b^2) - ((b*c - a*d)*sqrt(2/Pi)*erf(sqrt(2)*(a + b*x)))/b^2)
	@test integrate((c + d*x)^0*erf(a + b*x)^2, x) == :((2*erf(a + b*x))/(exp((a + b*x)^2*(b*sqrt)(Pi))) + ((a + b*x)*erf(a + b*x)^2)/b - (sqrt(2/Pi)*erf(sqrt(2)*(a + b*x)))/b)
	# @test integrate(erf(a + b*x)^2/(c + d*x)^1, x, 0) == :(x))
	# @test integrate(erf(a + b*x)^2/(c + d*x)^2, x, 0) == :(x))
	@test integrate(x^2*erf(d*(a + b*log(c*x^n))), x) == :((x^3*erf(d*(a + b*log(c*x^n))))/3 - (exp(((9 - 12*a*b*d^2*n)/(4*b^2*d^2*n^2))*x^3*erf)((2*a*b*d^2 - 3/n + 2*b^2*d^2*log(c*x^n))/(2*b*d)))/(3*(c*x^n)^(3/n)))
	@test integrate(x^1*erf(d*(a + b*log(c*x^n))), x) == :((x^2*erf(d*(a + b*log(c*x^n))))/2 - (exp(((1 - 2*a*b*d^2*n)/(b^2*d^2*n^2))*x^2*erf)((a*b*d^2 - n^(-1) + b^2*d^2*log(c*x^n))/(b*d)))/(2*(c*x^n)^(2/n)))
	@test integrate(x^0*erf(d*(a + b*log(c*x^n))), x) == :(x*erf(d*(a + b*log(c*x^n))) - (exp(((1 - 4*a*b*d^2*n)/(4*b^2*d^2*n^2))*x*erf)((2*a*b*d^2 - n^(-1) + 2*b^2*d^2*log(c*x^n))/(2*b*d)))/(c*x^n)^n^(-1))
	@test integrate(erf(d*(a + b*log(c*x^n)))/x^1, x) == :(1/(b*d*exp((d^2*(a + b*log)(c*x^n))^2)*n*sqrt(Pi)) + (erf(d*(a + b*log(c*x^n)))*(a + b*log(c*x^n)))/(b*n))
	@test integrate(erf(d*(a + b*log(c*x^n)))/x^2, x) == :(-(erf(d*(a + b*log(c*x^n)))/x) + (exp((1/(4*b^2*d^2*n^2) + a/(b*n))*(c*x^n)^n^(-1)*erf)((2*a*b*d^2 + n^(-1) + 2*b^2*d^2*log(c*x^n))/(2*b*d)))/x)
	@test integrate(erf(d*(a + b*log(c*x^n)))/x^3, x) == :(-erf(d*(a + b*log(c*x^n)))/(2*x^2) + (exp(((1 + 2*a*b*d^2*n)/(b^2*d^2*n^2))*(c*x^n)^(2/n)*erf)((1 + a*b*d^2*n + b^2*d^2*n*log(c*x^n))/(b*d*n)))/(2*x^2))
	@test integrate((e*x)^m*erf(d*(a + b*log(c*x^n))), x) == :(((e*x)^(1 + m)*erf(d*(a + b*log(c*x^n))))/(e*(1 + m)) + (exp((((1 + m)*(1 + m - 4*a*b*d^2*n))/(4*b^2*d^2*n^2))*x*(e*x)^m*erf)((1 + m - 2*a*b*d^2*n - 2*b^2*d^2*n*log(c*x^n))/(2*b*d*n)))/((1 + m)*(c*x^n)^((1 + m)/n)))
	@test integrate(exp((c - b^2*x^2)*erf)(b*x)^2, x) == :((exp(c*sqrt)(Pi)*erf(b*x)^3)/(6*b))
	@test integrate(exp((c - b^2*x^2)*erf)(b*x)^1, x) == :((exp(c*sqrt)(Pi)*erf(b*x)^2)/(4*b))
	@test integrate(exp((c - b^2*x^2)/erf)(b*x)^1, x) == :((exp(c*sqrt)(Pi)*log(erf(b*x)))/(2*b))
	@test integrate(exp((c - b^2*x^2)/erf)(b*x)^2, x) == :(-((exp(c*sqrt)(Pi))/(2*b*erf(b*x))))
	@test integrate(exp((c - b^2*x^2)/erf)(b*x)^3, x) == :(-((exp(c*sqrt)(Pi))/(4*b*erf(b*x)^2)))
	@test integrate(exp((c - b^2*x^2)*erf)(b*x)^n, x) == :((exp(c*sqrt)(Pi)*erf(b*x)^(1 + n))/(2*b*(1 + n)))
	@test integrate(x^5*exp((c + d*x^2)*erf)(b*x), x) == :(-((b*exp((c - (b^2 - d)*x^2)*x)/((b^2 - d)*d^2*sqrt)(Pi))) + (3*b*exp((c - (b^2 - d)*x^2)*x)/(4*(b^2 - d)^2*d*sqrt)(Pi)) + (b*exp((c - (b^2 - d)*x^2)*x^3)/(2*(b^2 - d)*d*sqrt)(Pi)) + (exp((c + d*x^2)*erf)(b*x))/d^3 - (exp((c + d*x^2)*x^2*erf)(b*x))/d^2 + (exp((c + d*x^2)*x^4*erf)(b*x))/(2*d) - (b*exp(c*erf)(sqrt(b^2 - d)*x))/(sqrt(b^2 - d)*d^3) + (b*exp(c*erf)(sqrt(b^2 - d)*x))/(2*(b^2 - d)^(3/2)*d^2) - (3*b*exp(c*erf)(sqrt(b^2 - d)*x))/(8*(b^2 - d)^(5/2)*d))
	@test integrate(x^3*exp((c + d*x^2)*erf)(b*x), x) == :((b*exp((c - (b^2 - d)*x^2)*x)/(2*(b^2 - d)*d*sqrt)(Pi)) - (exp((c + d*x^2)*erf)(b*x))/(2*d^2) + (exp((c + d*x^2)*x^2*erf)(b*x))/(2*d) + (b*exp(c*erf)(sqrt(b^2 - d)*x))/(2*sqrt(b^2 - d)*d^2) - (b*exp(c*erf)(sqrt(b^2 - d)*x))/(4*(b^2 - d)^(3/2)*d))
	@test integrate(x^1*exp((c + d*x^2)*erf)(b*x), x) == :((exp((c + d*x^2)*erf)(b*x))/(2*d) - (b*exp(c*erf)(sqrt(b^2 - d)*x))/(2*sqrt(b^2 - d)*d))
	# @test integrate(exp((c + d*x^2)*erf)(b*x)/x^1, x, 0) == :(x))
	# @test integrate(exp((c + d*x^2)*erf)(b*x)/x^3, x, 3) == :(x))
	# @test integrate(exp((c + d*x^2)*erf)(b*x)/x^5, x, 7) == :(x))
	# @test integrate(x^4*exp((c + d*x^2)*erf)(b*x), x, 5) == :(x))/(4*d^2))
	# @test integrate(x^2*exp((c + d*x^2)*erf)(b*x), x, 2) == :(x)/(2*d))
	# @test integrate(x^0*exp((c + d*x^2)*erf)(b*x), x, 0) == :(x))
	# @test integrate(exp((c + d*x^2)*erf)(b*x)/x^2, x, 2) == :(x))
	# @test integrate(exp((c + d*x^2)*erf)(b*x)/x^4, x, 5) == :(x))
	@test integrate(x^5*exp((c + b^2*x^2)*erf)(b*x), x) == :(-((2*exp(c*x)/(b^5*sqrt)(Pi))) + (2*exp(c*x^3)/(3*b^3*sqrt)(Pi)) - (exp(c*x^5)/(5*b*sqrt)(Pi)) + (exp((c + b^2*x^2)*erf)(b*x))/b^6 - (exp((c + b^2*x^2)*x^2*erf)(b*x))/b^4 + (exp((c + b^2*x^2)*x^4*erf)(b*x))/(2*b^2))
	@test integrate(x^3*exp((c + b^2*x^2)*erf)(b*x), x) == :((exp(c*x)/(b^3*sqrt)(Pi)) - (exp(c*x^3)/(3*b*sqrt)(Pi)) - (exp((c + b^2*x^2)*erf)(b*x))/(2*b^4) + (exp((c + b^2*x^2)*x^2*erf)(b*x))/(2*b^2))
	@test integrate(x^1*exp((c + b^2*x^2)*erf)(b*x), x) == :(-((exp(c*x)/(b*sqrt)(Pi))) + (exp((c + b^2*x^2)*erf)(b*x))/(2*b^2))
	# @test integrate(exp((c + b^2*x^2)*erf)(b*x)/x^1, x, 1, (2*b*exp(c*x*HypergeometricPFQ)({1/2, 1}, {3/2) == :(b^2*x^2))/sqrt(Pi))
	# @test integrate(exp((c + b^2*x^2)*erf)(b*x)/x^3, x, 4, -((b*exp(c)/(sqrt)(Pi)*x)) - (exp((c + b^2*x^2)*erf)(b*x))/(2*x^2) + (2*b^3*exp(c*x*HypergeometricPFQ)({1/2, 1}, {3/2) == :(b^2*x^2))/sqrt(Pi))
	# @test integrate(exp((c + b^2*x^2)*erf)(b*x)/x^5, x, 7, -((b*exp(c)/(6*sqrt)(Pi)*x^3)) - (b^3*exp(c)/(2*sqrt)(Pi)*x) - (exp((c + b^2*x^2)*erf)(b*x))/(4*x^4) - (b^2*exp((c + b^2*x^2)*erf)(b*x))/(4*x^2) + (b^5*exp(c*x*HypergeometricPFQ)({1/2, 1}, {3/2) == :(b^2*x^2))/sqrt(Pi))
	# @test integrate(x^4*exp((c + b^2*x^2)*erf)(b*x), x, 7, (3*exp(c*x^2)/(4*b^3*sqrt)(Pi)) - (exp(c*x^4)/(4*b*sqrt)(Pi)) - (3*exp((c + b^2*x^2)*x*erf)(b*x))/(4*b^4) + (exp((c + b^2*x^2)*x^3*erf)(b*x))/(2*b^2) + (3*exp(c*x^2*HypergeometricPFQ)({1, 1}, {3/2) == :(b^2*x^2))/(4*b^3*sqrt(Pi)))
