@testset "8.10 Formal derivatives" begin
	@test integrate(f'(x), x) == :(f(x))
	@test integrate(f''(x), x) == :(f'(x))
	@test integrate(f'''(x), x) == :(f''(x))
	@test integrate(Derivative(n)(f)(x), x) == :(Derivative(n-1)(f)(x))
	@test integrate(Derivative(1)(u)(x)*Derivative(2)(u)(x), x) == :(Derivative(1)(u)(x)^2/2)
	@test integrate(f'(x)/f(x), x) == :(log(f(x)))
	@test integrate(f'(x)/(a+b*f(x)), x) == :(log(a+b*f(x))/b)
	@test integrate(f(x)*f'(x), x) == :(f(x)^2/2)
	@test integrate((a+b*f(x))*f'(x), x) == :(a*f(x) + (1/2)*b*f(x)^2)
	@test integrate(f'(x)/sqrt(f(x)), x) == :(2*sqrt(f(x)))
	@test integrate(f'(x)/sqrt(a+b*f(x)), x) == :((2*sqrt(a+b*f(x)))/b)
	@test integrate(f(x)^n*f'(x), x) == :(f(x)^(n+1)/(n+1))
	@test integrate((a+b*f(x))^n*f'(x), x) == :((a+b*f(x))^(n+1)/(b*(n+1)))
	@test integrate(f''(x)/f'(x), x) == :(log(f'(x)))
	@test integrate(f''(x)/(a+b*f'(x)), x) == :(log(a+b*f'(x))/b)
	@test integrate(f'(x)*f''(x), x) == :(f'(x)^2/2)
	@test integrate((a+b*f'(x))*f''(x), x) == :(a*f'(x) + (1/2)*b*f'(x)^2)
	@test integrate(f''(x)/sqrt(f'(x)), x) == :(2*sqrt(f'(x)))
	@test integrate(f''(x)/sqrt(a+b*f'(x)), x) == :((2*sqrt(a+b*f'(x)))/b)
	@test integrate(f'(x)^n*f''(x), x) == :(f'(x)^(n+1)/(n+1))
	@test integrate((a+b*f'(x))^n*f''(x), x) == :((a+b*f'(x))^(n+1)/(b*(n+1)))
	# @test integrate(f(g(x))*g'(x), x, 1) == :(x))
	# @test integrate(f(g'(x))*g''(x), x, 1) == :(x))
	@test integrate(f'(x)*g(x) + f(x)*g'(x), x) == :(f(x)*g(x))
	@test integrate((f'(x)*g(x) - f(x)*g'(x))/g(x)^2, x) == :(f(x)/g(x))
	@test integrate((f'(x)*g(x) - f(x)*g'(x))/(f(x)*g(x)), x) == :(log(f(x)/g(x)))
	@test integrate((g(x)*Derivative(1)(f)(x) + f(x)*g'(x))/(1 + f(x)^2*g(x)^2), x) == :(atan(f(x)*g(x)))
	@test integrate((g(x)*Derivative(1)(f)(x) - f(x)*g'(x))/(f(x)^2 + g(x)^2), x) == :(atan(f(x)/g(x)))
	@test integrate(-((g(x)*Derivative(1)(f)(x) + f(x)*g'(x))/(1 + f(x)^2*g(x)^2)), x) == :(-atan(f(x)*g(x)))
	@test integrate((g(x)*Derivative(1)(f)(x) + f(x)*g'(x))/(1 - f(x)^2*g(x)^2), x) == :(atanh(f(x)*g(x)))
	@test integrate(((-g(x))*Derivative(1)(f)(x) + f(x)*g'(x))/(f(x)^2 - g(x)^2), x) == :(atanh(f(x)/g(x)))
	@test integrate((f(x)^(-1 + m)*g(x)^(-1 + n)*(m*g(x)*Derivative(1)(f)(x) + n*f(x)*g'(x)))/(1 - f(x)^(2*m)*g(x)^(2*n)), x) == :(atanh(f(x)^m*g(x)^n))
	@test integrate((f(x)^(-1 + m)*g(x)^(-1 + n)*((-m)*g(x)*Derivative(1)(f)(x) + n*f(x)*g'(x)))/(f(x)^(2*m) - g(x)^(2*n)), x) == :(atanh(g(x)^n/f(x)^m))
	@test integrate((f(x)^(-1 + m)*g(x)^(-1 - n)*((-m)*g(x)*Derivative(1)(f)(x) - n*f(x)*g'(x)))/(f(x)^(2*m) - g(x)^(-2*n)), x) == :(atanh(1/(f(x)^m*g(x)^n)))
	@test integrate((g(x)*Derivative(1)(f)(x) + f(x)*g'(x))/(a + b*f(x)^1*g(x)^1), x) == :(log(a + b*f(x)*g(x))/b)
	@test integrate((g(x)*Derivative(1)(f)(x) + f(x)*g'(x))/(a + b*f(x)^2*g(x)^2), x) == :(atan((sqrt(b)*f(x)*g(x))/sqrt(a))/(sqrt(a)*sqrt(b)))
