	@test integrate(cos(f(x)^2*g(x)^3)*f(x)*g(x)^2*(2*g(x)*Derivative(1)(f)(x) + 3*f(x)*g'(x)), x) == :(sin(f(x)^2*g(x)^3))
	@test integrate(cos(g(x)^3*Derivative(m)(f)(x)^2)*g(x)^2*Derivative(m)(f)(x)*(3*g'(x)*Derivative(m)(f)(x) + 2*g(x)*Derivative(1 + m)(f)(x)), x) == :(sin(g(x)^3*Derivative(m)(f)(x)^2))
	@test integrate(cos(Derivative(m)(f)(x)^2*Derivative(n)(g)(x)^3)*Derivative(m)(f)(x)*Derivative(n)(g)(x)^2*(2*Derivative(1 + m)(f)(x)*Derivative(n)(g)(x) + 3*Derivative(m)(f)(x)*Derivative(1 + n)(g)(x)), x) == :(sin(Derivative(m)(f)(x)^2*Derivative(n)(g)(x)^3))
	@test integrate((f(x)*g(x)^2*(2*g(x)*Derivative(1)(f)(x) + 3*f(x)*g'(x)))/(a + b*f(x)^4*g(x)^6), x) == :(atan((sqrt(b)*f(x)^2*g(x)^3)/sqrt(a))/(sqrt(a)*sqrt(b)))
	@test integrate((g(x)^2*Derivative(m)(f)(x)*(3*g'(x)*Derivative(m)(f)(x) + 2*g(x)*Derivative(1 + m)(f)(x)))/(a + b*g(x)^6*Derivative(m)(f)(x)^4), x) == :(atan((sqrt(b)*g(x)^3*Derivative(m)(f)(x)^2)/sqrt(a))/(sqrt(a)*sqrt(b)))
	@test integrate(Derivative(m)(f)(x)*Derivative(n)(g)(x)^2*(2*Derivative(1 + m)(f)(x)*Derivative(n)(g)(x) + 3*Derivative(m)(f)(x)*Derivative(1 + n)(g)(x))/(a + b*Derivative(m)(f)(x)^4*Derivative(n)(g)(x)^6), x) == :(atan((sqrt(b)*Derivative(m)(f)(x)^2*Derivative(n)(g)(x)^3)/sqrt(a))/(sqrt(a)*sqrt(b)))
	@test integrate(f(x)*g(x)^2*Derivative(1)(F)(f(x)^2*g(x)^3)*(2*g(x)*Derivative(1)(f)(x) + 3*f(x)*g'(x)), x) == :(F(f(x)^2*g(x)^3))
	@test integrate(g(x)^2*Derivative(1)(F)(g(x)^3*Derivative(m)(f)(x)^2)*Derivative(m)(f)(x)*(3*g'(x)*Derivative(m)(f)(x) + 2*g(x)*Derivative(1 + m)(f)(x)), x) == :(F(g(x)^3*Derivative(m)(f)(x)^2))
	@test integrate(Derivative(1)(F)(Derivative(m)(f)(x)^2*Derivative(n)(g)(x)^3)*Derivative(m)(f)(x)*Derivative(n)(g)(x)^2*(2*Derivative(1 + m)(f)(x)*Derivative(n)(g)(x) + 3*Derivative(m)(f)(x)*Derivative(1 + n)(g)(x)), x) == :(F(Derivative(m)(f)(x)^2*Derivative(n)(g)(x)^3))
end

@testset "8.2 Fresnel integral functions" begin
	@test integrate(x^7*FresnelS(b*x), x) == :(-((35*x^3*cos((1/2)*b^2*Pi*x^2))/(8*b^5*Pi^3)) + (x^7*cos((1/2)*b^2*Pi*x^2))/(8*b*Pi) - (105*FresnelS(b*x))/(8*b^8*Pi^4) + (1/8)*x^8*FresnelS(b*x) + (105*x*sin((1/2)*b^2*Pi*x^2))/(8*b^7*Pi^4) - (7*x^5*sin((1/2)*b^2*Pi*x^2))/(8*b^3*Pi^2))
	@test integrate(x^6*FresnelS(b*x), x) == :(-((24*x^2*cos((1/2)*b^2*Pi*x^2))/(7*b^5*Pi^3)) + (x^6*cos((1/2)*b^2*Pi*x^2))/(7*b*Pi) + (1/7)*x^7*FresnelS(b*x) + (48*sin((1/2)*b^2*Pi*x^2))/(7*b^7*Pi^4) - (6*x^4*sin((1/2)*b^2*Pi*x^2))/(7*b^3*Pi^2))
	@test integrate(x^5*FresnelS(b*x), x) == :(-((5*x*cos((1/2)*b^2*Pi*x^2))/(2*b^5*Pi^3)) + (x^5*cos((1/2)*b^2*Pi*x^2))/(6*b*Pi) + (5*FresnelC(b*x))/(2*b^6*Pi^3) + (1/6)*x^6*FresnelS(b*x) - (5*x^3*sin((1/2)*b^2*Pi*x^2))/(6*b^3*Pi^2))
	@test integrate(x^4*FresnelS(b*x), x) == :(-((8*cos((1/2)*b^2*Pi*x^2))/(5*b^5*Pi^3)) + (x^4*cos((1/2)*b^2*Pi*x^2))/(5*b*Pi) + (1/5)*x^5*FresnelS(b*x) - (4*x^2*sin((1/2)*b^2*Pi*x^2))/(5*b^3*Pi^2))
	@test integrate(x^3*FresnelS(b*x), x) == :((x^3*cos((1/2)*b^2*Pi*x^2))/(4*b*Pi) + (3*FresnelS(b*x))/(4*b^4*Pi^2) + (1/4)*x^4*FresnelS(b*x) - (3*x*sin((1/2)*b^2*Pi*x^2))/(4*b^3*Pi^2))
	@test integrate(x^2*FresnelS(b*x), x) == :((x^2*cos((1/2)*b^2*Pi*x^2))/(3*b*Pi) + (1/3)*x^3*FresnelS(b*x) - (2*sin((1/2)*b^2*Pi*x^2))/(3*b^3*Pi^2))
	@test integrate(x^1*FresnelS(b*x), x) == :((x*cos((1/2)*b^2*Pi*x^2))/(2*b*Pi) - FresnelC(b*x)/(2*b^2*Pi) + (1/2)*x^2*FresnelS(b*x))
	@test integrate(x^0*FresnelS(b*x), x) == :(cos((1/2)*b^2*Pi*x^2)/(b*Pi) + x*FresnelS(b*x))
	# @test integrate(FresnelS(b*x)/x^1, x, 3, (1/2)*I*b*x*HypergeometricPFQ({1/2, 1/2}, {3/2, 3/2}, (-(1/2))*I*b^2*Pi*x^2) - (1/2)*I*b*x*HypergeometricPFQ({1/2, 1/2}, {3/2) == :((1/2)*I*b^2*Pi*x^2))
	@test integrate(FresnelS(b*x)/x^2, x) == :(-(FresnelS(b*x)/x) + (1/2)*b*sinIntegral((1/2)*b^2*Pi*x^2))
	@test integrate(FresnelS(b*x)/x^3, x) == :((1/2)*b^2*Pi*FresnelC(b*x) - FresnelS(b*x)/(2*x^2) - (b*sin((1/2)*b^2*Pi*x^2))/(2*x))
	@test integrate(FresnelS(b*x)/x^4, x) == :((1/12)*b^3*Pi*cosIntegral((1/2)*b^2*Pi*x^2) - FresnelS(b*x)/(3*x^3) - (b*sin((1/2)*b^2*Pi*x^2))/(6*x^2))
	@test integrate(FresnelS(b*x)/x^5, x) == :(-((b^3*Pi*cos((1/2)*b^2*Pi*x^2))/(12*x)) - (1/12)*b^4*Pi^2*FresnelS(b*x) - FresnelS(b*x)/(4*x^4) - (b*sin((1/2)*b^2*Pi*x^2))/(12*x^3))
	@test integrate(FresnelS(b*x)/x^6, x) == :(-((b^3*Pi*cos((1/2)*b^2*Pi*x^2))/(40*x^2)) - FresnelS(b*x)/(5*x^5) - (b*sin((1/2)*b^2*Pi*x^2))/(20*x^4) - (1/80)*b^5*Pi^2*sinIntegral((1/2)*b^2*Pi*x^2))
