	@test integrate(FresnelS(b*x)/x^8, x) == :(-((b^3*Pi*cos((1/2)*b^2*Pi*x^2))/(168*x^4)) - (1/672)*b^7*Pi^3*cosIntegral((1/2)*b^2*Pi*x^2) - FresnelS(b*x)/(7*x^7) - (b*sin((1/2)*b^2*Pi*x^2))/(42*x^6) + (b^5*Pi^2*sin((1/2)*b^2*Pi*x^2))/(336*x^2))
	@test integrate(FresnelS(b*x)/x^9, x) == :(-((b^3*Pi*cos((1/2)*b^2*Pi*x^2))/(280*x^5)) + (b^7*Pi^3*cos((1/2)*b^2*Pi*x^2))/(840*x) + (1/840)*b^8*Pi^4*FresnelS(b*x) - FresnelS(b*x)/(8*x^8) - (b*sin((1/2)*b^2*Pi*x^2))/(56*x^7) + (b^5*Pi^2*sin((1/2)*b^2*Pi*x^2))/(840*x^3))
	@test integrate(FresnelS(b*x)/x^10, x) == :(-((b^3*Pi*cos((1/2)*b^2*Pi*x^2))/(432*x^6)) + (b^7*Pi^3*cos((1/2)*b^2*Pi*x^2))/(3456*x^2) - FresnelS(b*x)/(9*x^9) - (b*sin((1/2)*b^2*Pi*x^2))/(72*x^8) + (b^5*Pi^2*sin((1/2)*b^2*Pi*x^2))/(1728*x^4) + (b^9*Pi^4*sinIntegral((1/2)*b^2*Pi*x^2))/6912)
	@test integrate((c + d*x)^3*FresnelS(a + b*x), x) == :(((b*c - a*d)^3*cos((1/2)*Pi*(a + b*x)^2))/(b^4*Pi) + (3*d*(b*c - a*d)^2*(a + b*x)*cos((1/2)*Pi*(a + b*x)^2))/(2*b^4*Pi) + (d^2*(b*c - a*d)*(a + b*x)^2*cos((1/2)*Pi*(a + b*x)^2))/(b^4*Pi) + (d^3*(a + b*x)^3*cos((1/2)*Pi*(a + b*x)^2))/(4*b^4*Pi) - (3*d*(b*c - a*d)^2*FresnelC(a + b*x))/(2*b^4*Pi) - ((b*c - a*d)^4*FresnelS(a + b*x))/(4*b^4*d) + (3*d^3*FresnelS(a + b*x))/(4*b^4*Pi^2) + ((c + d*x)^4*FresnelS(a + b*x))/(4*d) - (2*d^2*(b*c - a*d)*sin((1/2)*Pi*(a + b*x)^2))/(b^4*Pi^2) - (3*d^3*(a + b*x)*sin((1/2)*Pi*(a + b*x)^2))/(4*b^4*Pi^2))
	@test integrate((c + d*x)^2*FresnelS(a + b*x), x) == :(((b*c - a*d)^2*cos((1/2)*Pi*(a + b*x)^2))/(b^3*Pi) + (d*(b*c - a*d)*(a + b*x)*cos((1/2)*Pi*(a + b*x)^2))/(b^3*Pi) + (d^2*(a + b*x)^2*cos((1/2)*Pi*(a + b*x)^2))/(3*b^3*Pi) - (d*(b*c - a*d)*FresnelC(a + b*x))/(b^3*Pi) - ((b*c - a*d)^3*FresnelS(a + b*x))/(3*b^3*d) + ((c + d*x)^3*FresnelS(a + b*x))/(3*d) - (2*d^2*sin((1/2)*Pi*(a + b*x)^2))/(3*b^3*Pi^2))
	@test integrate((c + d*x)^1*FresnelS(a + b*x), x) == :(((b*c - a*d)*cos((1/2)*Pi*(a + b*x)^2))/(b^2*Pi) + (d*(a + b*x)*cos((1/2)*Pi*(a + b*x)^2))/(2*b^2*Pi) - (d*FresnelC(a + b*x))/(2*b^2*Pi) - ((b*c - a*d)^2*FresnelS(a + b*x))/(2*b^2*d) + ((c + d*x)^2*FresnelS(a + b*x))/(2*d))
	@test integrate((c + d*x)^0*FresnelS(a + b*x), x) == :(cos((1/2)*Pi*(a + b*x)^2)/(b*Pi) + ((a + b*x)*FresnelS(a + b*x))/b)
