@testset "8.9 Product logarithm function" begin
	@test integrate(Productlog(a + b*x)^4, x) == :(96*x - (96*(a + b*x))/(b*Productlog(a + b*x)) - (48*(a + b*x)*Productlog(a + b*x))/b + (16*(a + b*x)*Productlog(a + b*x)^2)/b - (4*(a + b*x)*Productlog(a + b*x)^3)/b + ((a + b*x)*Productlog(a + b*x)^4)/b)
	@test integrate(Productlog(a + b*x)^3, x) == :(-18*x + (18*(a + b*x))/(b*Productlog(a + b*x)) + (9*(a + b*x)*Productlog(a + b*x))/b - (3*(a + b*x)*Productlog(a + b*x)^2)/b + ((a + b*x)*Productlog(a + b*x)^3)/b)
	@test integrate(Productlog(a + b*x)^2, x) == :(4*x - (4*(a + b*x))/(b*Productlog(a + b*x)) - (2*(a + b*x)*Productlog(a + b*x))/b + ((a + b*x)*Productlog(a + b*x)^2)/b)
	@test integrate(Productlog(a + b*x), x) == :(-x + (a + b*x)/(b*Productlog(a + b*x)) + ((a + b*x)*Productlog(a + b*x))/b)
	@test integrate(1/Productlog(a + b*x), x) == :(expIntegralEi(Productlog(a + b*x))/b + (a + b*x)/(b*Productlog(a + b*x)))
	@test integrate(1/Productlog(a + b*x)^2, x) == :((2*expIntegralEi(Productlog(a + b*x)))/b - (a + b*x)/(b*Productlog(a + b*x)^2))
	@test integrate(1/Productlog(a + b*x)^3, x) == :((3*expIntegralEi(Productlog(a + b*x)))/(2*b) - (a + b*x)/(2*b*Productlog(a + b*x)^3) - (3*(a + b*x))/(2*b*Productlog(a + b*x)^2))
	@test integrate(1/Productlog(a + b*x)^4, x) == :((2*expIntegralEi(Productlog(a + b*x)))/(3*b) - (a + b*x)/(3*b*Productlog(a + b*x)^4) - (2*(a + b*x))/(3*b*Productlog(a + b*x)^3) - (2*(a + b*x))/(3*b*Productlog(a + b*x)^2))
	@test integrate(1/Productlog(a + b*x)^5, x) == :((5*expIntegralEi(Productlog(a + b*x)))/(24*b) - (a + b*x)/(4*b*Productlog(a + b*x)^5) - (5*(a + b*x))/(12*b*Productlog(a + b*x)^4) - (5*(a + b*x))/(24*b*Productlog(a + b*x)^3) - (5*(a + b*x))/(24*b*Productlog(a + b*x)^2))
	@test integrate((c*Productlog(a+b*x))^(5/2), x) == :((75*c^(5/2)*sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(16*b) - (75*c^3*(a + b*x))/(8*b*sqrt(c*Productlog(a + b*x))) + (25*c^2*(a + b*x)*sqrt(c*Productlog(a + b*x)))/(4*b) - (5*c*(a + b*x)*(c*Productlog(a + b*x))^(3/2))/(2*b) + ((a + b*x)*(c*Productlog(a + b*x))^(5/2))/b)
	@test integrate((c*Productlog(a+b*x))^(3/2), x) == :(-((9*c^(3/2)*sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(8*b)) + (9*c^2*(a + b*x))/(4*b*sqrt(c*Productlog(a + b*x))) - (3*c*(a + b*x)*sqrt(c*Productlog(a + b*x)))/(2*b) + ((a + b*x)*(c*Productlog(a + b*x))^(3/2))/b)
	@test integrate(sqrt(c*Productlog(a+b*x)), x) == :((sqrt(c)*sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(4*b) - (c*(a + b*x))/(2*b*sqrt(c*Productlog(a + b*x))) + ((a + b*x)*sqrt(c*Productlog(a + b*x)))/b)
	@test integrate(1/sqrt(c*Productlog(a+b*x)), x) == :((sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(2*b*sqrt(c)) + (a + b*x)/(b*sqrt(c*Productlog(a + b*x))))
	@test integrate(1/(c*Productlog(a+b*x))^(3/2), x) == :((3*sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(b*c^(3/2)) - (2*(a + b*x))/(b*(c*Productlog(a + b*x))^(3/2)))
	@test integrate(1/(c*Productlog(a+b*x))^(5/2), x) == :((10*sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(3*b*c^(5/2)) - (2*(a + b*x))/(3*b*(c*Productlog(a + b*x))^(5/2)) - (10*(a + b*x))/(3*b*c*(c*Productlog(a + b*x))^(3/2)))
	@test integrate(1/(c*Productlog(a+b*x))^(7/2), x) == :((28*sqrt(Pi)*erfi(sqrt(c*Productlog(a + b*x))/sqrt(c)))/(15*b*c^(7/2)) - (2*(a + b*x))/(5*b*(c*Productlog(a + b*x))^(7/2)) - (14*(a + b*x))/(15*b*c*(c*Productlog(a + b*x))^(5/2)) - (28*(a + b*x))/(15*b*c^2*(c*Productlog(a + b*x))^(3/2)))
	@test integrate((-c*Productlog(a+b*x))^(5/2), x) == :((75*c^(5/2)*sqrt(Pi)*erf(sqrt((-c)*Productlog(a + b*x))/sqrt(c)))/(16*b) + (75*c^3*(a + b*x))/(8*b*sqrt((-c)*Productlog(a + b*x))) + (25*c^2*(a + b*x)*sqrt((-c)*Productlog(a + b*x)))/(4*b) + (5*c*(a + b*x)*((-c)*Productlog(a + b*x))^(3/2))/(2*b) + ((a + b*x)*((-c)*Productlog(a + b*x))^(5/2))/b)
	@test integrate((-c*Productlog(a+b*x))^(3/2), x) == :((9*c^(3/2)*sqrt(Pi)*erf(sqrt((-c)*Productlog(a + b*x))/sqrt(c)))/(8*b) + (9*c^2*(a + b*x))/(4*b*sqrt((-c)*Productlog(a + b*x))) + (3*c*(a + b*x)*sqrt((-c)*Productlog(a + b*x)))/(2*b) + ((a + b*x)*((-c)*Productlog(a + b*x))^(3/2))/b)
	@test integrate(sqrt(-c*Productlog(a+b*x)), x) == :((sqrt(c)*sqrt(Pi)*erf(sqrt((-c)*Productlog(a + b*x))/sqrt(c)))/(4*b) + (c*(a + b*x))/(2*b*sqrt((-c)*Productlog(a + b*x))) + ((a + b*x)*sqrt((-c)*Productlog(a + b*x)))/b)
	@test integrate(1/sqrt(-c*Productlog(a+b*x)), x) == :(-((sqrt(Pi)*erf(sqrt((-c)*Productlog(a + b*x))/sqrt(c)))/(2*b*sqrt(c))) + (a + b*x)/(b*sqrt((-c)*Productlog(a + b*x))))
	@test integrate(1/(-c*Productlog(a+b*x))^(3/2), x) == :((3*sqrt(Pi)*erf(sqrt((-c)*Productlog(a + b*x))/sqrt(c)))/(b*c^(3/2)) - (2*(a + b*x))/(b*((-c)*Productlog(a + b*x))^(3/2)))
	@test integrate(1/(-c*Productlog(a+b*x))^(5/2), x) == :(-((10*sqrt(Pi)*erf(sqrt((-c)*Productlog(a + b*x))/sqrt(c)))/(3*b*c^(5/2))) - (2*(a + b*x))/(3*b*((-c)*Productlog(a + b*x))^(5/2)) + (10*(a + b*x))/(3*b*c*((-c)*Productlog(a + b*x))^(3/2)))
